import React, {Component, Fragment} from "react";
import {MDBContainer} from "mdbreact";
import NavbarPage from "./Components/navbar";
import "./index.css";
import BoxPage from "./Components/textbox";
import GridBlock from "./Components/grid";





class App extends Component{
  constructor(props){
    super(props);
    this.state = {
      items:[],
      isLoaded:false,
    }

  }


componentDidMount(){

  fetch("https://api.unsplash.com/search/photos?query=movies&limit=10&client_id=cz_uQE-jqdAx0A4ZMyd38aWHz4UUDLQuWIg-S3f3lO0")
  .then(Response => Response.json())
  .then(json =>this.setState({isLoaded:true, items:json,}))

}




  render(){
var {isLoaded, items} = this.state;

if(!isLoaded) {
  return <div>  Loading......</div>
}
else{


    return(
      <Fragment>
      
      <MDBContainer fluid className="header-container">
      <NavbarPage />
      <BoxPage />
      </MDBContainer>
      <GridBlock />
      <ul>
        {items.map(item =>(
          <li key={item.id}>{item.description}  </li>
        ))}
      </ul>
     
      </Fragment>
        
      
    );
  }
  }
}
export default App;
